import React from "react";
import ReactDOM from "react-dom";
import BarChartComponent from "./Components/BarChart";
import AreaChartComponent from "./Components/AreaChart";
import CandleStickChartComponent from "./Components/CandleStickChart";
import LineAndScatterChartComponent from "./Components/LineAndScatterChart";
import StackedBarChartComponent from "./Components/StackedBarChart";
import HorizontalBarChartComponent from "./Components/HorizontalBarChart";
import GroupedBarChartComponent from "./Components/GroupedBarChart";
import BubbleChartComponent from "./Components/BubbleChart";
import VolumeProfileChartComponent from "./Components/VolumeProfileChart";
import OHLCChartWithElderRayIndicatorComponent from "./Components/OHLCChartWithElderRayIndicator";
import PointAndFigureChartComponent from "./Components/PointAndFigureChart";
import RenkoChartComponent from "./Components/RenkoChart";
import KagiChartComponent from "./Components/KagiChart";
import HeikinAshiChartComponent from "./Components/HeikinAshiChart";
import VolumeProfileBySessionChartComponent from "./Components/VolumeProfileBySessionChart";

const App = () => {
  return (
    <div>
      <h1>Bar Chart</h1>
      <BarChartComponent />

      <h1>Area Chart</h1>
      <AreaChartComponent />

      <h1>Candlestick Chart</h1>
      <CandleStickChartComponent />

      <h1>Line and Scatter Chart</h1>
      <LineAndScatterChartComponent />

      <h1>Stacked Bar Chart</h1>
      <StackedBarChartComponent />

      <h1>Horizontal Bar Chart</h1>
      <HorizontalBarChartComponent />

      <h1>Grouped Bar Chart</h1>
      <GroupedBarChartComponent />

      <h1>Bubble Chart</h1>
      <BubbleChartComponent />

      <h1>Volume Profile Chart</h1>
      <VolumeProfileChartComponent />

      <h1>OHLC Chart with Elder Ray Indicator</h1>
      <OHLCChartWithElderRayIndicatorComponent />

      <h1>Point and Figure Chart</h1>
      <PointAndFigureChartComponent />

      <h1>Renko Chart</h1>
      <RenkoChartComponent />

      <h1>Kagi Chart</h1>
      <KagiChartComponent />

      <h1>Heikin Ashi Chart</h1>
      <HeikinAshiChartComponent />

      <h1>Volume Profile by Session Chart</h1>
      <VolumeProfileBySessionChartComponent />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
